import React, { useState } from "react";
import { Link } from "react-router-dom";
import Logo from "./assets/asset-logo.png";
import "./Header.css";

export default function Header() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    return (
        <header className="Header">
            {/* Logo for header */}
            <img src={Logo} className="Logo" alt="logo" />

            {/* Burger menu */}
            <div className={`BurgerMenu ${isMenuOpen ? "open" : ""}`} onClick={toggleMenu}></div>

            {/* Navigation */}
            <nav className={`Navbar ${isMenuOpen ? "open" : ""}`}>
                {/* List of Nav items */}
                <ul className="nav">
                    {/* Nav item: inputpage */}
                    <li>
                        {/* Link to inputpage route */}
                        <Link className="nav-link" to="/InputPage">
                            Input Page
                        </Link>
                    </li>
                    {/* Nav item: View Expenses */}
                    <li>
                        {/* Link to view expenses route */}
                        <Link className="nav-link" to="/ViewExpenses">
                            View Expenses
                        </Link>
                    </li>
                    {/* Nav item: Find Expenses */}
                    <li>
                        {/* Link to find expenses route */}
                        <Link className="nav-link" to="/FindExpenses">
                            Find Expenses
                        </Link>
                    </li>
                </ul>
                <button>Login</button>
            </nav>
        </header>
    );
}
